import { Grid, Typography } from "@mui/material";

const Expiriances = () => {
  return (
    <Grid container alignItems="baseline">
      <Grid item xs={6}>
        <Typography variant="h6">Senior Software Engineer</Typography>
        <Typography variant="h6">Perfectial/Avenga</Typography>
      </Grid>
      <Grid item xs={6}>
        <Typography variant="body1">November 2021 - till present</Typography>
        <Typography variant="body2">Projects:</Typography>
        <Typography variant="body2">
          Cryptocurrency. Application cryptocurrency wallet, and trade
          cryptocurrency, cryptoWallet cryptocurrency. Exchange crypto for any
          money, realEtate
        </Typography>
        <Typography variant="body2">Responsibilities:</Typography>
        <List
      sx={{
        width: '100%',
        maxWidth: 360,
        bgcolor: 'background.paper',
        position: 'relative',
        overflow: 'auto',
        maxHeight: 300,
        '& ul': { padding: 0 },
      }}
      subheader={<li />}
    >
      {[0, 1, 2, 3, 4].map((sectionId) => (
        <li key={`section-${sectionId}`}>
          <ul>
            <ListSubheader>{`I'm sticky ${sectionId}`}</ListSubheader>
            {[0, 1, 2].map((item) => (
              <ListItem key={`item-${sectionId}-${item}`}>
                <ListItemText primary={`Item ${item}`} />
              </ListItem>
            ))}
          </ul>
        </li>
      ))}
    </List>
      </Grid>
      <Grid item xs={6}></Grid>
      <Grid item xs={6}></Grid>
    </Grid>
  );
};

export default Expiriances;
